pub enum GitClientError {
    IoError(io::Error),
    DirectoryNotFound,
    CommitInvalid,
    IndexCorrupt,
}

pub enum Tree {
    BlobEntry {
        blob_name: String,
        hash_code: String,
    },
    TreeEntry {
        tree_name: String,
        hash_code: String,
        children: Vec<Tree>,
    },
}
